using namespace std;

namespace __MATRIX__ {
	using row = vector<float>;
	using matrix = vector<row>;

	matrix operator+ (const matrix& a, const matrix& b) {
		matrix ret = a;
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[i][j] += b[i][j];
		return ret;
	}

	matrix operator- (const matrix& a, const matrix& b) {
		matrix ret = a;
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[i][j] -= b[i][j];
		return ret;
	}

	matrix operator* (const matrix& a, const matrix& b) {
		matrix ret = a;
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[i][j] *= b[i][j];
		return ret;
	}

	matrix operator+ (float a, const matrix& b) {
		matrix ret = b;
		for (int i = 0; i < b.size(); i++) for (int j = 0; j < b[0].size(); j++)
			ret[i][j] += a;
		return ret;
	}

	matrix operator- (float a, const matrix& b) {
		matrix ret = b;
		for (int i = 0; i < b.size(); i++) for (int j = 0; j < b[0].size(); j++)
			ret[i][j] -= a;
		return ret;
	}

	matrix operator* (float a, const matrix& b) {
		matrix ret = b;
		for (int i = 0; i < b.size(); i++) for (int j = 0; j < b[0].size(); j++)
			ret[i][j] *= a;
		return ret;
	}

	matrix dot(const matrix& a, const matrix& b) {
		matrix ret(a.size(), row(b[0].size()));
		for (int i = 0; i < ret.size(); i++) for (int j = 0; j < ret[0].size(); j++)
			for (int k = 0; k < a[0].size(); k++) ret[i][j] += a[i][k] * b[k][j];
		return ret;
	}

	matrix transpose(const matrix& a) {
		matrix ret(a[0].size(), row(a.size()));
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[j][i] = a[i][j];
		return ret;
	}
}
using namespace __MATRIX__;

struct Sigmoid {
	float operator() (float x) {
		return 1. / (1. + exp(-x));
	}

	matrix operator() (matrix x) {
		matrix ret = x;
		for (auto& i : ret) for (auto& j : i)
			j = (*this)(j);
		return ret;
	}

	matrix deriv(matrix x) {
		return (*this)(x) * (1 - (*this)(x));
	}
};

struct MSE {
	float operator() (matrix res, matrix y) {
		float ret = 0;
		for (int i = 0; i < y.size(); i++) for (int j = 0; j < y[0].size(); j++)
			ret += (res[i][j] - y[i][j]) * (res[i][j] - y[i][j]);
		return ret;
	}

	matrix deriv(matrix res, matrix y) {
		return res - y;
	}
};

mt19937 rd((unsigned)chrono::steady_clock::now().time_since_epoch().count());
float _rand() { return normal_distribution<float>(0, 1)(rd); }

template<typename Act_F = Sigmoid, typename Cost_F = MSE>
struct Network {
	vector<int> shape; vector<matrix> w, b;
	Act_F activation_f{}; Cost_F cost_f{};

	Network(vector<int> shape) : shape(shape) {
		for (int i = 1; i < shape.size(); i++) {
			w.push_back(matrix(shape[i], row(shape[i - 1])));
			b.push_back(matrix(shape[i], row(1)));
			for (auto& i : w.back()) for (auto& j : i) j = _rand();
			for (auto& i : b.back()) for (auto& j : i) j = _rand();
		}
	}

	matrix forward(matrix x) {
		auto ret = x;
		for (int i = 0; i < w.size(); i++)
			ret = activation_f(dot(w[i], ret) + b[i]);
		return ret;
	}

	int Calc(matrix x) {
		auto res = forward(x);
		float mx = res[0][0]; int idx = 0;
		for (int i = 1; i < 10; i++) {
			if (mx >= res[i][0]) continue;
			mx = res[i][0]; idx = i;
		}
		return idx;
	}
};

